<!DOCTYPE html>
<html lang="ja">
<head>
<meta charset="UTF-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>兵庫県 防災行政無線チャイム 検索マップシステム</title>

<style>
  /* Base Styles */
  * { box-sizing: border-box; }
  body {
    margin: 0;
    font-family: sans-serif, Arial, "ヒラギノ角ゴ ProN W3", "Hiragino Kaku Gothic ProN", Meiryo, sans-serif;
    background: linear-gradient(45deg, #FFEFEF, #E7EFFF, #EFFFFB, #F7FCE8);
    background-size: 300% 300%;
    animation: bgAnimation 15s ease infinite;
    color: #333;
    line-height: 1.6;
  }
  @keyframes bgAnimation {
    0% { background-position: 0% 50%;}
    50%{ background-position: 100% 50%;}
    100%{ background-position: 0% 50%;}
  }

  /* --- Loading Screen Styles --- */
  .loader-overlay {
    position: fixed;
    top: 0; left: 0;
    width: 100%; height: 100%;
    background: rgba(255, 255, 255, 0.85);
    backdrop-filter: blur(5px);
    z-index: 9999;
    display: flex;
    justify-content: center;
    align-items: center;
    transition: opacity .5s ease;
  }
  .loader-overlay.loaded {
    opacity: 0;
    pointer-events: none;
  }
  .loader-content {
    text-align: center;
    width: 80%;
    max-width: 400px;
  }
  .loader-bar-container {
    width: 100%;
    height: 18px;
    background: #e0e0e0;
    border-radius: 9px;
    overflow: hidden;
    box-shadow: inset 0 2px 4px rgba(0,0,0,.1);
  }
  .loader-bar {
    width: 0%;
    height: 100%;
    background: linear-gradient(90deg, #42a5f5, #1e88e5);
    border-radius: 9px;
    transition: width 0.2s ease-out;
  }
  .loader-text {
    margin-top: 0.75rem;
    font-size: 0.9rem;
    color: #555;
    font-family: monospace;
    font-weight: bold;
  }


  /* Header */
  header {
    position: sticky;
    top: 0;
    z-index: 10;
    backdrop-filter: blur(6px);
    background: rgba(255,255,255,.85);
    border-bottom: 1px solid #eee;
    padding: .7rem 1rem;
    display: flex;
    align-items: center;
    gap: 1rem;
  }
  /* [NEW] Style for the header logo link */
  header a {
    display: inline-block;
    line-height: 0; /* Ensures the link doesn't add extra space */
  }
  header img { height: 36px; }
  header h1 { font-size: 1.1rem; font-weight: 700; margin: 0; }

  /* Layout */
  main { max-width: 1200px; margin: 1rem auto; padding: 0 1rem 2rem; }
  .grid {
    display: grid;
    grid-template-columns: minmax(280px, 0.9fr) 1.7fr;
    gap: 1.5rem;
  }
  @media (max-width: 900px) {
    .grid { grid-template-columns: 1fr; }
  }

  /* Card */
  .card {
    background: rgba(255,255,255,.75);
    backdrop-filter: blur(6px);
    border: 1px solid #eee;
    border-radius: 12px;
    box-shadow: 0 2px 8px rgba(0,0,0,.06);
    overflow: hidden;
  }
  .card h2 {
    font-size: 1rem; padding: .9rem 1rem; margin: 0;
    border-bottom: 1px solid #eee; background: #fff;
  }
  .card-body { padding: .8rem; }

  /* Map Area */
  .map-wrap { width: 100%; overflow: auto; position: relative; }
  .map-wrap svg { width: 100%; height: auto; display: block; }
  .map-placeholder-text {
    padding: 3rem 1rem;
    text-align: center;
    color: #888;
    background-color: #f9f9f9;
    border: 2px dashed #ddd;
    border-radius: 8px;
    margin: .5rem;
  }
  #N03-20250101_28 path {
    fill: #43a047;
    stroke: #ffffff;
    stroke-width: .6;
    cursor: pointer;
    transition: fill .15s ease, filter .15s ease;
    outline: none;
  }
  #N03-20250101_28 path:hover {
    fill: #ffdd57;
    stroke: #333;
    stroke-width: .8;
  }
  #N03-20250101_28 path.is-active {
    fill: #2e7d32 !important;
    filter: drop-shadow(0 0 6px rgba(0,0,0,.25));
  }
  #tooltip {
    position: absolute;
    display: none;
    background: rgba(0,0,0,.75);
    color: #fff;
    padding: 5px 10px;
    border-radius: 6px;
    font-size: 0.9rem;
    pointer-events: none;
    z-index: 100;
    white-space: nowrap;
  }

  /* Search & Results Area */
  .toolbar {
    display: flex; gap: .5rem; flex-wrap: wrap; align-items: center; margin-bottom: .6rem;
  }
  .toolbar input {
    flex: 1 1 200px;
    padding: .55rem .7rem; border: 1px solid #ddd; border-radius: 8px; background: #fff;
  }
  .toolbar button {
    padding:.55rem .9rem; border:1px solid #ddd; border-radius:8px; background:#fff; cursor: pointer;
  }
  .toolbar button.primary { background: #337ab7; color: #fff; border-color: #2e6da4; }
  .result-header { display: flex; align-items: center; gap: .5rem; margin-bottom: .3rem; }
  .result-header h3 { margin: 0; font-size: 1.05rem; }
  .badge {
    display: inline-block; padding: .2rem .5rem; border-radius: 9999px; font-size: .75rem;
    background: #ffcc00; color: #333; font-weight: 700; vertical-align: middle;
  }
  .muted { color: #666; font-size: .9rem; }
  .notice {
    background: #fffce6; border: 1px dashed #e6d04f; padding: .7rem .8rem; border-radius: 8px; margin: .4rem 0;
  }
  #noticeBox {
    margin-top: 1rem;
  }

  /* Table */
  .table-container { overflow:auto; max-height: 65vh; border:1px solid #eee; border-radius:10px; }
  table {
    width: 100%;
    border-collapse: collapse;
    background: #fff;
    table-layout: fixed;
  }
  thead th {
    position: sticky; top: 0; background: #fafafa; z-index: 1;
    font-weight: 700; border-bottom: 2px solid #ddd; padding: .6rem .4rem; text-align: left; font-size: 0.85rem;
  }
  tbody td {
    border-bottom: 1px solid #f0f0f0; padding: .5rem .4rem; vertical-align: top; font-size: 0.85rem;
    word-break: break-word;
  }
  tbody tr:hover { background: #fffdf0; }

  thead th:nth-child(1) { width: 60px; }
  thead th:nth-child(4),
  thead th:nth-child(5) { width: 8%; }

  /* --- [NEW] Footer Styles --- */
  footer {
    text-align: center;
    padding: 2rem 1rem;
    margin-top: 1rem;
    border-top: 1px solid #eee;
  }
  .footer-link-button {
    display: inline-flex;
    align-items: center;
    gap: 0.75rem;
    background-color: #fff;
    border: 1px solid #ccc;
    padding: 0.75rem 1.5rem;
    border-radius: 8px;
    color: #333;
    text-decoration: none;
    font-weight: bold;
    box-shadow: 0 2px 4px rgba(0,0,0,.05);
    transition: all .2s ease;
  }
  .footer-link-button:hover {
    transform: translateY(-2px);
    box-shadow: 0 4px 8px rgba(0,0,0,.1);
    border-color: #aaa;
  }
  .footer-link-button img {
    height: 24px;
  }

  /* Print-specific Styles */
  @media print {
    body { background: none; color: #000; }
    header, .grid > section:first-child, .toolbar, .notice, #tooltip, .loader-overlay, footer { display: none; }
    main { margin: 1rem; padding: 0; }
    .grid { display: block; }
    .card { box-shadow: none; border: none; }
    .result-header { margin-bottom: 1rem; padding-bottom: 0.5rem; border-bottom: 2px solid #000; }
    .result-header .badge, .result-header .muted { display: none; }
    .result-header h3 { font-size: 14pt; }
    .table-container { max-height: none; overflow: visible; border: none; }
    table { width: 100%; font-size: 9pt; border-collapse: collapse; table-layout: auto; }
    thead { background-color: #eee !important; }
    th, td { border: 1px solid #888; padding: 4px 6px; }
    tbody tr { page-break-inside: avoid; }
  }
</style>
</head>

<script>
const SHEET_CSV =
  "https://docs.google.com/spreadsheets/d/e/2PACX-1vRf5GMF-hBxFCzXD0zYFGzDinO1ZUV2r8kpoAvObCYV0UCtOR__eSb-JJP7EYioAzPGyiAHTmS8bypz/pub?output=csv";

function parseCSV(text) {
  const rows = []; let row = []; let field = ""; let inQuotes = false;
  for (let i = 0; i < text.length; i++) {
    const c = text[i]; const n = text[i+1];
    if (inQuotes) {
      if (c === '"' && n === '"') { field += '"'; i++; }
      else if (c === '"') { inQuotes = false; }
      else { field += c; }
    } else {
      if (c === '"') inQuotes = true;
      else if (c === ',') { row.push(field); field = ""; }
      else if (c === '\n') { row.push(field); rows.push(row); row = []; field = ""; }
      else if (c === '\r') { /* skip */ }
      else { field += c; }
    }
  }
  if (field.length > 0 || row.length > 0) { row.push(field); rows.push(row); }
  return rows;
}

let ALL = []; let NOTICES = [];
async function loadData() {
  const res = await fetch(SHEET_CSV);
  const text = await res.text();
  const rows = parseCSV(text);
  if (!rows.length) throw new Error("空のCSV");
  const header = rows[0].map(s => s.trim());
  const dataRows = rows.slice(1);
  const idx = (names) => header.findIndex(h => names.some(n => h.includes(n)));
  const cols = { A: idx(["番号"]), B: idx(["市区町村"]), C: idx(["メーカー"]), D: idx(["運用方式"]), E: idx(["地域"]), F: idx(["時刻"]), G: idx(["時期"]), H: idx(["音種"]), I: idx(["曲名"]), J: idx(["備考"]) };
  let lastValues = {};
  const colKeys = { B: 'city', C: 'maker', D: 'method', E: 'area', F: 'time', G: 'season', H: 'kind', I: 'title', J: 'note' };

  dataRows.forEach(r => {
    const pick = (i) => (i >= 0 && i < r.length ? (r[i]||"").trim() : "");
    let rec = { number: pick(cols.A) };
    let isNewCityBlock = !!pick(cols.B);
    
    if (isNewCityBlock) {
      lastValues = {};
    }
    
    for (const [col, key] of Object.entries(colKeys)) {
      const val = pick(cols[col]);
      rec[key] = val || (lastValues[key] || "");
      if (val) {
        lastValues[key] = val;
      }
    }

    const isNoticeByArea = rec.area && !rec.time && !rec.title;
    const isNoticeByMaker = rec.maker && !rec.method && !rec.time && !rec.title;

    if (isNoticeByArea || isNoticeByMaker) {
      const noticeText = rec.area || rec.maker;
      NOTICES.push({ city: rec.city, text: noticeText });
    } else {
      ALL.push(rec);
    }
  });
}

const tbody = document.getElementById("tbody");
const currentAreaEl = document.getElementById("currentArea");
const hitCountEl = document.getElementById("hitCount");
const statusMsgEl = document.getElementById("statusMsg");
const noticeBox = document.getElementById("noticeBox");
let currentCity = "";
let qEl = null;

function render() {
  const q = (qEl.value || "").trim().toLowerCase();
  let rows = ALL.slice();
  if (currentCity) rows = rows.filter(x => x.city === currentCity);
  if (q) {
    rows = rows.filter(x =>
      (x.city||"").toLowerCase().includes(q) || (x.title||"").toLowerCase().includes(q) ||
      (x.maker||"").toLowerCase().includes(q) || (x.note||"").toLowerCase().includes(q)
    );
  }
  tbody.innerHTML = rows.map(r => `
    <tr>
      <td>${esc(r.time)}</td><td>${esc(r.title)}</td><td>${esc(r.city)}</td>
      <td>${esc(r.season)}</td><td>${esc(r.kind)}</td><td>${esc(r.maker)}</td>
      <td>${esc(r.method)}</td><td>${esc(r.area)}</td><td>${esc(r.note)}</td>
    </tr>
  `).join("");
  currentAreaEl.textContent = currentCity ? currentCity : "全自治体";
  hitCountEl.textContent = `${rows.length}件`;
  statusMsgEl.textContent = q ? "（検索中）" : "";
  const notices = NOTICES.filter(n => {
    if (currentCity) return n.city === currentCity;
    if (q) return (n.city || "").toLowerCase().includes(q) || (n.text || "").toLowerCase().includes(q);
    return true;
  });
  noticeBox.innerHTML = notices.length ? notices.map(n => `<div class="notice"><strong>${esc(n.city || "")}：</strong> ${linkify(esc(n.text))}</div>`).join("") : "";
}
function esc(s){ return (s||"").replace(/[&<>"']/g, m=>({ "&":"&amp;","<":"&lt;",">":"&gt;",'"':"&quot;","'":"&#39;" }[m])); }
function linkify(s){ return s.replace(/(https?:\/\/[^\s]+)/g, '<a href="$1" target="_blank" rel="noopener noreferrer">$1</a>'); }

function selectCity(cityName) {
  currentCity = cityName;
  const mapPaths = document.querySelectorAll("#N03-20250101_28 path");
  
  mapPaths.forEach(p => {
    if ((p.getAttribute("data-name") || p.getAttribute("id") || "") === cityName) {
      p.classList.add("is-active");
    } else {
      p.classList.remove("is-active");
    }
  });

  render();
}

function setupMapClicks() {
  const group = document.querySelector("#N03-20250101_28");
  if (!group) return;

  const placeholder = document.getElementById("mapPlaceholder");
  if(placeholder) placeholder.remove();

  const tooltip = document.getElementById("tooltip");
  const mapWrap = document.getElementById("mapWrap");
  const mapWrapRect = mapWrap.getBoundingClientRect();

  mapWrap.addEventListener("mousemove", (e) => {
    const scrollLeft = mapWrap.scrollLeft;
    const scrollTop = mapWrap.scrollTop;
    const x = e.pageX - mapWrapRect.left - window.scrollX + scrollLeft;
    const y = e.pageY - mapWrapRect.top - window.scrollY + scrollTop;
    tooltip.style.left = `${x + 15}px`;
    tooltip.style.top = `${y + 15}px`;
  });

  const paths = group.querySelectorAll("path");
  paths.forEach(p => {
    const name = p.getAttribute("data-name") || p.getAttribute("id") || "";
    p.addEventListener("mouseover", () => { if (name) { tooltip.textContent = name; tooltip.style.display = "block"; } });
    p.addEventListener("mouseout", () => { tooltip.style.display = "none"; });
    p.addEventListener("click", () => {
      selectCity(name);
    });
    p.setAttribute("tabindex", "0");
    p.addEventListener("keydown", (e) => { if (e.key === "Enter" || e.key === " ") { e.preventDefault(); p.click(); } });
  });
}

window.addEventListener("DOMContentLoaded", async () => {
  const loader = document.getElementById('loader');
  const loaderBar = document.getElementById('loaderBar');
  const loaderText = document.getElementById('loaderText');
  let progress = 0;
  const interval = setInterval(() => {
    progress += Math.random() * 5;
    if (progress > 95) progress = 95;
    loaderBar.style.width = progress + '%';
    loaderText.textContent = `Loading ${Math.round(progress)}%`;
  }, 100);

  qEl = document.getElementById("q");
  document.getElementById("searchBtn").addEventListener("click", render);
  document.getElementById("printBtn").addEventListener("click", () => { window.print(); });
  qEl.addEventListener("keydown", (e) => { if (e.key === 'Enter') { e.preventDefault(); render(); } });
  document.getElementById("clearBtn").addEventListener("click", () => {
    qEl.value = "";
    selectCity("");
  });
  try {
    await loadData();
    render();
    setupMapClicks();
  } catch (e) {
    document.getElementById("statusMsg").textContent = "データ取得エラー：" + e.message;
  } finally {
    clearInterval(interval);
    loaderBar.style.width = '100%';
    loaderText.textContent = 'Complete 100%';
    setTimeout(() => {
        loader.classList.add('loaded');
    }, 300);
    setTimeout(() => {
        loader.style.display = 'none';
    }, 800);
  }
});
</script>

</body>
</html>
